package anshulcode_2;

public class Fibo2 {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
        
		
		
		int num=10;
		 int m=0;
		 int o=1;
			System.out.println(m);
			System.out.println(o);
			
			while (num>0) {
				int p= m+o;
				System.out.println(p);
				m=o;
				o=p;
				num--;
			}
		
		
		
		
		
		
		
		
		
		
	}

}
